	import React, { useState, useEffect } from "react";
    import * as THREE from 'three'
    import STFLoader from 'three-stf-loader';
    import { useLoader } from 'react-three-fiber'



function Stl(){

    const stf = useLoader(STLLoader, "./models/gear.stl")
    return (
    <primitive object={stf.scene} dispose={null} />
    )


};

export default Stl;
